  return (
    <Router>
      <Switch>
        <Route exact path="/" component={LoginView}></Route>
        <Route exact path="/ingreso" component={LoginView}></Route>
        <Route exact path="/usuarios" component={UsersView}>
          {loginAccess ? <UsersView /> : <Redirect to="/" />}
        </Route>
        <Route exact path="/crear" component={CreateUserView}></Route>
        <Route path="*" component={Error404View}></Route>
      </Switch>
    </Router>
  );
};

export default AppRouter;
